import React from "react";
import {
  ButtonBack,
  ButtonFirst,
  ButtonLast,
  ButtonNext,
  CarouselProvider,
  Slide,
  Slider,
  ImageWithZoom,
  DotGroup,
  Dot,
} from "pure-react-carousel";
import "pure-react-carousel/dist/react-carousel.es.css";
import "./SlickCard.css";

const SlickCard = () => {
  return (
    <CarouselProvider
      naturalSlideWidth={100}
      naturalSlideHeight={125}
      totalSlides={3}
      className="row"
    >
      <div>
        <Dot slide={0}>1</Dot>
        <Dot slide={1}>2</Dot>
        <Dot slide={2}>3</Dot>
      </div>
      <Slider
        style={{ color: "#eee", backgroundColor: "yellow", height: "100%" }}
      >
        <Slide index={0}>
          <div
            style={{ width: "100%", height: "800px", backgroundColor: "red" }}
          >
            <ImageWithZoom src="http://localhost:5000/uploads/2022-01-11T23:57:22.071Zc9f0f895fb98ab9159f51fd0297e236d2020112711493146905goqRXNpKFf.jpg" />
          </div>
        </Slide>
        <Slide index={1}>
          <div
            style={{
              width: "100%",
              height: "500px",
              backgroundColor: "blue",
            }}
          >
            <ImageWithZoom src="http://localhost:5000/uploads/2022-01-11T23:57:22.071Zc9f0f895fb98ab9159f51fd0297e236d2020112711493146905goqRXNpKFf.jpg" />
          </div>
        </Slide>
        <Slide index={2}>
          <div
            style={{
              width: "100%",
              height: "500px",
              backgroundColor: "green",
            }}
          >
            <ImageWithZoom src="http://localhost:5000/uploads/2022-01-11T23:57:22.071Zc9f0f895fb98ab9159f51fd0297e236d2020112711493146905goqRXNpKFf.jpg" />
          </div>
        </Slide>
      </Slider>
    </CarouselProvider>
  );
};

export default SlickCard;
